import { useState } from 'react'

const LoginPage = () => {

    const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')

    const onSubmit = (e) => {
        e.preventDefault()

        if(!username) {
            alert('Please enter your username')
            return
        }

        if(!password) {
            alert('Please enter your username')
            return
        }

        onAdd({text, day, reminder})

        setUsername('')
        setPassword('')
    }

    const onLoginSubmit = (e) => {
        e.preventDefault()

        if(!username) {
            alert('Please enter your username')
            return
        }

        if(!password) {
            alert('Please enter your username')
            return
        }

        onAdd({text, day, reminder})

        setUsername('')
        setPassword('')
    }

    const onSignUpSubmit = (e) => {
        e.preventDefault()
        
    }

    return (
        <div className='container'>
            <h1>Welcome to DocApp!</h1>
            <form className="add-form">
                <div className="form-control">
                    <label> Username </label>
                    <input  type="text"
                            placeholder="Enter username" value={username} onChange={(e) => setUsername(e.target.value)} />
                </div>
                <div className="form-control">
                    <label> Password </label>
                    <input type="password" placeholder="Enter password" value={password} onChange={(e) => setPassword(e.target.value)}/>
                </div>

                <button type="submit" id='btn-login' className="btn btn-block" onClick={(e) => onLoginSubmit(e)}>
                    Log In
                </button>
                <div>
                    <label> You don't have an account yet? Sign up! </label>
                </div>
                <button type="submit" id='btn-sign-up' className="btn btn-block" onClick={(e) => onSignUpSubmit(e)}>
                    Sign Up
                </button>
            </form>
        </div>
    )
}

export default LoginPage
